/* http://meyerweb.com/eric/tools/css/reset/ 
   v2.0 | 20110126
   License: none (public domain)
*/

html,
body,
div,
span,
applet,
object,
iframe,
h1,
h2,
h3,
h4,
h5,
h6,
p,
blockquote,
pre,
a,
abbr,
acronym,
address,
big,
cite,
code,
del,
dfn,
em,
img,
ins,
kbd,
q,
s,
samp,
small,
strike,
strong,
sub,
sup,
tt,
var,
b,
u,
i,
center,
dl,
dt,
dd,
ol,
ul,
li,
fieldset,
form,
label,
legend,
table,
caption,
tbody,
tfoot,
thead,
tr,
th,
td,
article,
aside,
canvas,
details,
embed,
figure,
figcaption,
footer,
header,
hgroup,
menu,
nav,
output,
ruby,
section,
summary,
time,
mark,
audio,
video {
	margin: 0;
	padding: 0;
	border: 0;
	font-size: 100%;
	font: inherit;
	vertical-align: baseline;
}
/* HTML5 display-role reset for older browsers */
article,
aside,
details,
figcaption,
figure,
footer,
header,
hgroup,
menu,
nav,
section {
	display: block;
}
body {
	line-height: 1;
}
ol,
ul {
	list-style: none;
}
blockquote,
q {
	quotes: none;
}
blockquote:before,
blockquote:after,
q:before,
q:after {
	content: '';
	content: none;
}
table {
	border-collapse: collapse;
	border-spacing: 0;
}

html,
body {
	box-sizing: border-box;
	font-family: 'Roboto', sans-serif;
	font-size: 62.5%;
}
:root {
	--primary-color: #141414;
	--header-background: #00000000;
	--header-background-scroll: #181818e6;
	--text-color: #ffffff;
	--red: #ea3c2a;
	--orange: #ea6016;
	--light-orange: #ff8800;
	--primary-button-background: linear-gradient(
		90deg,
		var(--light-orange),
		var(--red) 50%,
		var(--light-orange)
	);
	--primary-button-shadow: 0 0 14px -1px var(--light-orange);
	--card-shadow: 0 0 14px -1px var(--light-orange);
	--link-hover-color: var(--orange);
	--box-shadow-blue: 0 4px 8px 0 var(#09ccc74d);
	--search-background: #ffffff1a;
	--heading-before-background: linear-gradient(
		180deg,
		var(--light-orange),
		var(--red)
	);
	--user-info-back-ground: #353434;
	--user-info-hover-item: #403f3f;
}
.padding-side-100 {
	padding: 0 10rem;
}
